import React from "react";
import { Link } from "react-router-dom";

class Dashboard extends React.PureComponent {
  render() {
    return (
      <>
        <div className="mx-20 mt-30  border ">
          <h2 className="mb-5 mt-10 pt-20">Dashboard</h2>
          <Link className="p-1 bg-gray-500" to="AddPost">
            Add Posts
          </Link>
        </div>
      </>
    );
  }
}
export default Dashboard;
